import 'package:rx_dart_notes/core/models/note_model.dart';import 'package:rx_dart_notes/core/models/note_response_model.dart';import 'package:rx_dart_notes/core/services/notes_service.dart';class NoteRepository{  final NoteService _apiService = NoteService();  Future<NoteResponseModel> getNote(){    return _apiService.getNotesResponseList();  }  Future<NoteResponseModel> createNote(NoteModel newNote) {    return _apiService.createOneNote(newNote);  }}